Dövlət satınalmalarının vahid internet portalı üzrə təlimat (07.07.2024) 




Təchizatçının adının üzərinə klik etdikdə açılan pəncərədə "Qiymət təklifi" və "Texniki 
təklif" bölmələri əks olunur. Pəncərənin sol tərəfində satınalan təşkilat tərəfindən qoyulan 
tələblər, sağ tərəfində isə təchizatçı tərəfindən tələbə dair qeyd edilən məlumatlar və 
yüklənmiş sənədlər əks olunur. Qiymətləndirmə aşağıda qeyd olunan tələblər üzrə aparılır:   
1) Satınalmanın balı -Satınalma formalaşdırılarkən müəyyənləşdirilən meyarların çəkisi;  
2) Təklifin balı - Sistem tərəfindən avtomatik olaraq hesablanmış təklifin balı; 
3) Yekun bal -  Qiymət təklifinin balı ilə texniki təklifin balının cəmi;  
4) Qiymətləndirmə üsulu ‐ Satınalma formalaşdırılarkən müəyyənləşdirilən meyar;  
5) Qiymətləndirməyə  dair  qeydlər - Satınalan təşkilat tərəfindən qiymətləndirmə 
prosesində qeydlərin daxil edildiyi bölmə. 
6) Satınalma güzəştinin tətbiq edilməsi
